   "source": [
    "# Final Project for Introduction to Regression Analysis\n",
    "\n",
    "## Dataset\n",
    "Body Fat Prediction Dataset, Kaggle, https://www.kaggle.com/datasets/fedesoriano/body-fat-prediction-dataset \n",
    "### Details\n",
    "There are n = 251 observations and 15 attributes:\n",
    "* `Density` = Density determined from underwater weighing\n",
    "* `BodyFat` = Percent body fat from Siri's (1956) equation (which includes aforementioned density)\n",
    "* `Age` = Age (years)\n",
    "* `Weight` = Weight (lbs)\n",
    "* `Height` = Height (inches)\n",
    "* `Neck` = Neck circumference (cm)\n",
    "* `Chest` = Chest circumference (cm)\n",
    "* `Abdomen` = Abdomen lateral circumference (cm)\n",
    "* `Hip` = Hip circumference (cm)\n",
    "* `Thigh` = Thigh circumference (cm)\n",
    "* `Knee` = Knee circumference (cm)\n",
    "* `Ankle` = Ankle circumference (cm)\n",
    "* `Biceps` = Biceps (extended) circumference (cm)\n",
    "* `Forearm` = Forearm circumference (cm)\n",
    "* `Wrist` = Wrist circumference (cm)\n",
    "\n",
    "## Research Question(s): \n",
    "Which body measurements are most important to consider when predicting Body Fat Percentage?\n",
    "\n",
    "Which body measurements should be included in a regression model in order to find the best fit?\n",
    "\n",
    "Which body measurements are independent of the others and which measurements may be dependent?"
   ]
  },
