   "source": [
    "We should exclude `Density` because `BodyFat` is formulaically dependent on it. Additionally, there are two values which are likely incorrect: `BodyFat` equaling .7 and .0. Body fat percentages are deadly below 1% (1.0), and there are no recorded individuals with such a physique. Thus it makes sense to exclude those data points. The zero-value would also prevent Box-Cox analysis (as `BodyFat` is the predictor variable), which gives further reason to remove those rows of data."
   ]
