    "# First Group of Plots (BodyFat, Age, Weight, Height)\n",
    "options(repr.plot.width=16, repr.plot.height=12)\n",
    "par(mfrow=c(4,3))\n",
    "# Body Fat\n",
    "plot(density(BodyFat,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Body Fat Percentage\",xlab=\"Body Fat Percentage\")\n",
    "rug(BodyFat)\n",
    "boxplot(BodyFat, main=\"Box Plot for Body Fat Percentage\", ylab=\"Body Fat Percentage\")\n",
    "qqnorm(BodyFat, main=\"Normal Q-Q Plot for Body Fat Percentage\", ylab = \"Body Fat Percentage\")\n",
    "qqline(BodyFat, lty = 2, col=2)\n",
    "# Age\n",
    "plot(density(Age,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Age\",xlab=\"Age\")\n",
    "rug(Age)\n",
    "boxplot(Age, main=\"Box Plot for Age\", ylab=\"Age\")\n",
    "qqnorm(Age, main=\"Normal Q-Q Plot for Age\", ylab = \"Age\")\n",
    "qqline(Age, lty = 2, col=2)\n",
    "# Weight\n",
    "plot(density(Weight,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Weight\",xlab=\"Weight (lbs)\")\n",
    "rug(Weight)\n",
    "boxplot(Weight, main=\"Box Plot for Weight\", ylab=\"Weight (lbs)\")\n",
    "qqnorm(Weight, main=\"Normal Q-Q Plot for Weight\", ylab = \"Weight (lbs)\")\n",
    "qqline(Weight, lty = 2, col=2)\n",
    "# Height\n",
    "plot(density(Height,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Height\",xlab=\"Height (inches)\")\n",
    "rug(Height)\n",
    "boxplot(Height, main=\"Box Plot for Height\", ylab=\"Height (inches)\")\n",
    "qqnorm(Height, main=\"Normal Q-Q Plot for Height\", ylab = \"Height (inches)\")\n",
    "qqline(Height, lty = 2, col=2)\n",
    "# Second Group of Plots (Neck, Chest, Abdomen, Hip)\n",
    "par(mfrow=c(4,3))\n",
    "# Neck\n",
    "plot(density(Neck,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Neck Circumference\",xlab=\"Neck Circumference (cm)\")\n",
    "rug(Neck)\n",
    "boxplot(Neck, main=\"Box Plot for Neck Circumference\", ylab=\"Neck Circumference (cm)\")\n",
    "qqnorm(Neck, main=\"Normal Q-Q Plot for Neck Circumference\", ylab = \"Neck Circumference (cm)\")\n",
    "qqline(Neck, lty = 2, col=2)\n",
    "# Chest\n",
    "plot(density(Chest,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Chest Circumference\",xlab=\"Chest Circumference (cm)\")\n",
    "rug(Chest)\n",
    "boxplot(Chest, main=\"Box Plot for Chest Circumference\", ylab=\"Chest Circumference (cm)\")\n",
    "qqnorm(Chest, main=\"Normal Q-Q Plot for Chest Circumference\", ylab = \"Chest Circumference (cm)\")\n",
    "qqline(Chest, lty = 2, col=2)\n",
    "# Abdomen\n",
    "plot(density(Abdomen,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Abdomen Circumference\",xlab=\"Abdomen Circumference (cm)\")\n",
    "rug(Abdomen)\n",
    "boxplot(Abdomen, main=\"Box Plot for Abdomen Circumference\", ylab=\"Abdomen Circumference (cm)\")\n",
    "qqnorm(Abdomen, main=\"Normal Q-Q Plot for Abdomen Circumference\", ylab = \"Abdomen Circumference (cm)\")\n",
    "qqline(Abdomen, lty = 2, col=2)\n",
    "# Hip\n",
    "plot(density(Hip,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Hip Circumference\",xlab=\"Hip Circumference (cm)\")\n",
    "rug(Hip)\n",
    "boxplot(Hip, main=\"Box Plot for Hip Circumference\", ylab=\"Hip Circumference (cm)\")\n",
    "qqnorm(Hip, main=\"Normal Q-Q Plot for Hip Circumference\", ylab = \"Hip Circumference (cm)\")\n",
    "qqline(Hip, lty = 2, col=2)\n",
    "# Third Group of Plots (Thigh, Knee, Ankle, Biceps)\n",
    "par(mfrow=c(4,3))\n",
    "# Thigh\n",
    "plot(density(Thigh,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Thigh Circumference\",xlab=\"Thigh Circumference (cm)\")\n",
    "rug(Thigh)\n",
    "boxplot(Thigh, main=\"Box Plot for Thigh Circumference\", ylab=\"Thigh Circumference (cm)\")\n",
    "qqnorm(Thigh, main=\"Normal Q-Q Plot for Thigh Circumference\", ylab = \"Thigh Circumference (cm)\")\n",
    "qqline(Thigh, lty = 2, col=2)\n",
    "# Knee\n",
    "plot(density(Knee,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Knee Circumference\",xlab=\"Knee Circumference (cm)\")\n",
    "rug(Knee)\n",
    "boxplot(Knee,main=\"Box Plot for Knee Circumference\",  ylab=\"Knee Circumference (cm)\")\n",
    "qqnorm(Knee, main=\"Normal Q-Q Plot for Knee Circumference\", ylab = \"Knee Circumference (cm)\")\n",
    "qqline(Knee, lty = 2, col=2)\n",
    "# Ankle\n",
    "plot(density(Ankle,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Ankle Circumference\",xlab=\"Ankle Circumference (cm)\")\n",
    "rug(Ankle)\n",
    "boxplot(Ankle, main=\"Box Plot for Ankle Circumference\", ylab=\"Ankle Circumference (cm)\")\n",
    "qqnorm(Ankle, main=\"Normal Q-Q Plot for Ankle Circumference\", ylab = \"Ankle Circumference (cm)\")\n",
    "qqline(Ankle, lty = 2, col=2)\n",
    "# Biceps\n",
    "plot(density(Biceps,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Biceps Circumference\",xlab=\"Biceps Circumference (cm)\")\n",
    "rug(Biceps)\n",
    "boxplot(Biceps, main=\"Box Plot for Biceps Circumference\", ylab=\"Biceps Circumference (cm)\")\n",
    "qqnorm(Biceps, main=\"Normal Q-Q Plot for Biceps Circumference\", ylab = \"Biceps Circumference (cm)\")\n",
    "qqline(Biceps, lty = 2, col=2)\n",
    "# Fourth Group of Plots (Forearm, Wrist)\n",
    "options(repr.plot.width=16, repr.plot.height=6)\n",
    "par(mfrow=c(2,3))\n",
    "# Forearm\n",
    "plot(density(Forearm,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Neck Circumference\",xlab=\"Neck Circumference (cm)\")\n",
    "rug(Forearm)\n",
    "boxplot(Forearm, main=\"Box Plot for Forearm Circumference\", ylab=\"Forearm Circumference (cm)\")\n",
    "qqnorm(Forearm, main=\"Normal Q-Q Plot for Forearm Circumference\", ylab = \"Forearm Circumference (cm)\")\n",
    "qqline(Forearm, lty = 2, col=2)\n",
    "# Wrist\n",
    "plot(density(Wrist,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE for Wrist Circumference\",xlab=\"Wrist Circumference (cm)\")\n",
    "rug(Wrist)\n",
    "boxplot(Wrist, main=\"Box Plot for Wrist Circumference\", ylab=\"Wrist Circumference (cm)\")\n",
    "qqnorm(Wrist, main=\"Normal Q-Q Plot for Wrist Circumference\", ylab = \"Wrist Circumference (cm)\")\n",
    "qqline(Wrist, lty = 2, col=2)"
