   "source": [
    "# Normality Checks: Plot Overview\n",
    "# Establish Plot Size\n",
    "options(repr.plot.width=8, repr.plot.height=4)\n",
    "par(mfrow=c(1,2))\n",
    "# BodyFat\n",
    "plot(density(BodyFat,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE Y\",xlab=\"Body Fat Percentage\")\n",
    "rug(BodyFat)\n",
    "qqnorm(BodyFat, main=\"Normal Q-Q Plot Y\", ylab = \"Body Fat Percentage\")\n",
    "qqline(BodyFat, lty = 2, col=2)\n",
    "# New Plot Size\n",
    "options(repr.plot.width=14, repr.plot.height=10)\n",
    "par(mfrow=c(3,5))\n",
    "# Age\n",
    "plot(density(Age,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE X1\",xlab=\"Age\")\n",
    "rug(Age)\n",
    "# Weight\n",
    "plot(density(Weight,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE X2\",xlab=\"Weight (lbs)\")\n",
    "rug(Weight)\n",
    "# Height\n",
    "plot(density(Height,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE X3\",xlab=\"Height (inches)\")\n",
    "rug(Height)\n",
    "# Neck\n",
    "plot(density(Neck,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE X4\",xlab=\"Neck Circumference (cm)\")\n",
    "rug(Neck)\n",
    "# Chest\n",
    "plot(density(Chest,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE X5\",xlab=\"Chest Circumference (cm)\")\n",
    "rug(Chest)\n",
    "# Abdomen\n",
    "plot(density(Abdomen,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE X6\",xlab=\"Abdomen Circumference (cm)\")\n",
    "rug(Abdomen)\n",
    "# Hip\n",
    "plot(density(Hip,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE X7\",xlab=\"Hip Circumference (cm)\")\n",
    "rug(Hip)\n",
    "# Thigh\n",
    "plot(density(Thigh,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE X8\",xlab=\"Thigh Circumference (cm)\")\n",
    "rug(Thigh)\n",
    "# Knee\n",
    "plot(density(Knee,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE X9\",xlab=\"Knee Circumference (cm)\")\n",
    "rug(Knee)\n",
    "# Ankle\n",
    "plot(density(Ankle,bw=\"SJ\",kern=\"gaussian\"),type=\"l\",\n",
    "     main=\"Gaussian KDE X10\",xlab=\"Ankle Circumference (cm)\")\n",
